import React from 'react';
import { Button, Divider, Form, Input, Typography, message,} from 'antd';
import {FacebookFilled, TwitterOutlined, GoogleOutlined, InstagramFilled} from '@ant-design/icons'
import "../styles/Login.css";

const Login = () => {
  
   const login = () =>{
      message.success('Login Successful !');
   };

   return (
    <div className="appBg">
      <Form className='loginForm'>
         <Typography.Title>Welcome Back !</Typography.Title>
         <Form.Item label='Email' name={'Email'}>
            <Input placeholder='Enter Your email'/>
         </Form.Item>
         <Form.Item label='Password' name={'pswd'}>
            <Input placeholder='Enter Your password'/>
         </Form.Item>
         <Button type='primary' htmlType='submit' block>Login</Button>
         <Divider style={{borderColor: "black"}}>or Login with</Divider>
         <div className='socialLogin'>
            <GoogleOutlined className='socialIcon' onClick={login}/>
            <FacebookFilled className='socialIcon' onClick={login} style={{color: "blue"}}/>
            <InstagramFilled className='socialIcon' onClick={login} style={{color: "pink"}}/>
         </div>
      </Form>
    </div>
  )
}

export default Login
